import BuscaBD from "./components/fetchBackEnd/api"


export const IsAutenticated = async () => {
    const key = localStorage.getItem("auth")
    if (!key) { return false }
    const classBuscaBD = new BuscaBD
    const { data } = await classBuscaBD.ValidaTokenPainel()
    console.log(data)

    return await data


}
